import { NavLink } from "react-router-dom";

const RootLayout = () => {
    return (
        <>
            <header>
                <nav>
                <h1>Jobarouter</h1>
                <NavLink to="/">Home</NavLink>
                <NavLink to="about">About</NavLink>
                <NavLink to="home">Home</NavLink>
                </nav>
            </header>
            <main>
                <Outle />
            </main>
            <footer><h1>Footer</h1></footer>
        </>
    );
}

export default RootLayout;
